import React, {useState} from "react";
import intern from "./internship.json";

const Internship = () => {

    return <>
        {
            intern.map((i) => (
                <div>
					<h2>Internship Experience</h2>
                    <h4>{i.Company}</h4>
					<h4>{i.Role + " | " + i.Location + " | " + i.Time}</h4>
                    <p>{i.Description}</p>
                </div>
            ))
        }
    </>
}

export default Internship
